export default {
  name: "frIcon",
  props: {
    icon: {
      type: String,
      required: true
    },
    size: {
      type: String,
      default: 'default'
    }
  },
  computed: {
    fs: function fs() {
      if (this.size === 'large') {
        return '3rem';
      }

      if (this.size === 'default') {
        return '1.7rem';
      }

      if (this.size === 'mid') {
        return '1.5rem';
      }

      if (this.size === 'small') {
        return '1rem';
      } else {
        return '1.7rem';
      }
    },
    wh: function wh() {
      return {
        width: this.fs,
        height: this.fs
      };
    }
  }
};
